function SupportSection() {
  return (
    <section id="support" className="bg-blue-600 text-white py-20">
      <div className="container mx-auto px-6 md:px-20 text-center">
        <h2 className="text-3xl font-bold mb-6">Need Help?</h2>
        <p className="text-lg mb-6">
          If you have questions or need support, contact us and we will help you get started quickly!
        </p>
        <a 
          href="mailto:support@aicontent.com" 
          className="bg-white text-blue-600 font-bold py-3 px-6 rounded-xl hover:shadow-lg transition"
        >
          Contact Support
        </a>
      </div>
    </section>
  );
}

export default SupportSection;
